import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl, { waitUntil: 'domcontentloaded' });

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // The provided HTML doesn't have the sort controls visible by default.
    // We need to perform a search first to make them appear.
    // 1. Fill the search input
    await page.locator('#searchInput').fill('phone');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_filled.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_filled.png'));

    // 2. Click the search button
    // Using page.locator with a class and then first() to be specific
    await page.locator('.search-btn').first().click();

    // Wait for the search results and sort controls to be rendered by the script
    await page.waitForSelector('#sortSelect');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_results.png'));

    // 3. Locate and select the price sort option
    const sortDropdown = page.locator('#sortSelect');
    await sortDropdown.selectOption('price-low');

    // Take a screenshot after applying the sort
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_price_sort_applied.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_price_sort_applied.png'));

    // 4. Extract data to verify the action
    const selectedValue = await sortDropdown.inputValue();
    const selectedText = await sortDropdown.evaluate(el => {
      const selectedOption = el.options[el.selectedIndex];
      return selectedOption ? selectedOption.textContent : null;
    });

    return {
      success: true,
      action: "Applied 'Price: Low to High' sort filter after performing a search.",
      extractedData: {
        selectedValue: selectedValue,
        selectedText: selectedText
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // In case of an error, capture the final state of the page
    const errorScreenshotPath = path.join(screenshotsDir, 'error_screenshot.png');
    await page.screenshot({ path: errorScreenshotPath });

    return {
      success: false,
      action: "Failed to apply price sort filter",
      extractedData: {},
      screenshots: [errorScreenshotPath],
      error: error.message
    };
  }
}
